import React from "react";

export default class ViewItems extends React.Component {
  render() {
    let items = this.props.items;
    return (
      <div>
        {items.length>0 && <table>
          <thead>
            <tr>
              <th>Task</th>
              <th>Due date</th>
            </tr>
          </thead>
          {items.map((item, i) => {
            return (
              <tbody>
                <tr key = {i}>
                  <td key = {i}>{item.task}</td>
                  <td key = {i}>{item.duedate}</td>
                </tr>
              </tbody>
            );
          })}
        </table>}
      </div>
    );
  }
}
